import React from "react";
import { useParams } from "react-router";
import Mmore from '../Components/Mmore';

const More = ()=>{
    const {recipe} = useParams();
    <>
    <div className="Container bg-light border" >
                {recipe.map(item=>(
                    <div key={recipe.name}>
                        <h3>
                        {item.strMeal}
                        </h3>
                        <img className="imgRecipe" src={item.strMealThumb} alt={item.strMeal}>
                        </img>
                        
                    </div>
                ))}
            </div>
    </>
}

export {More}
